import { createStore } from "../../CustomStore/store";
import { CartReducer } from "./cart/reducer";

const rootReducer = (state = {}, action = {}) => {
  return {
    cart: CartReducer(state.cart, action)
  };
}

export const store = createStore(rootReducer);
